import React, { Component } from "react";

import "./App.css";

class Wrapper extends Component {
  constructor(props) {
    super(props);
    this.state = {
      1: { title: "Test", imgsrc: "test" }
    };
  }
  render() {
    return (
      <div className="portfolio-wrapper">
        <PorfolioItem />
        <PorfolioItem />
        <PorfolioItem />
        <PorfolioItem />
        <PorfolioItem />
        <PorfolioItem />
        <PorfolioItem />
        <PorfolioItem />
        <PorfolioItem />
      </div>
    );
  }
}

class PorfolioItem extends Component {
  render() {
    return <div />;
  }
}

export default Wrapper;
